import { BUDGET_CHANGE, CATEGORY_CHANGE } from "../config/actionType";

export const budgetOnChange = budget => {
  return {
    type: BUDGET_CHANGE,
    payload: budget
  };
};

export const categoryOnChange = category => {
  return {
    type: CATEGORY_CHANGE,
    payload: category
  };
};
